import React from 'react';
import BotCard from './BotCard';

const YourBotArmy = ({ bots, onRelease, onDischarge }) => {
  return (
    <div>
      {bots.map(bot => (
        <BotCard 
          key={bot.id} 
          bot={bot} 
          onRelease={onRelease}
          onDischarge={onDischarge}
        />
      ))}
    </div>
  );
};

export default YourBotArmy;
